('2146','7','9174','GS Tiesmeier',Null,'Meerblick-Baugrundstück für eine Einfamilien-Villa mit Gästehaus in der Cala Llamp','30528','Die Cala Llamp ist eine sehr beliebte Villenwohnlage in Puerto de Andratx im Südwesten Mallorcas.\r\nDrei Baugrundstücke in Hanglage wurden hier zu einem Baugrundstück zusammengelegt. Die westliche Ausrichtung und der Panorama-Meerblick bieten spektakuläre Sonnenuntergänge. Der Bauaushub wird Ende Januar 2014 abgeschlossenen sein. Geplant und genehmigt ist eine Einfamilien-Villa mit 2 Wohnetagen und Keller/Tiefgarage (ca.1000 m² konstruierte Fläche) und ein separates Gästehaus (ca. 300 m²). Des Weiteren sind in der Planung diverse Terrassen und ein Pool vorgesehen. Verkauft wird das Grundstück inklusive der Kosten des Bauaushubs und einer genehmigten Bauvoranfrage (proyecto básico).','30529','2300000','111','2013-12-19 13:11:04','110','2013-12-19 13:11:23',Null,'2054','166','124',1,'1','0',Null,Null,Null,'30530',Null,'0','0','0',Null,'2015-05-22 10:50:54',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'30531',Null,'30532',Null,'30533',Null,'30534',Null,'30535','0',0,'0');
